import logo from "./logo.svg";
import "./App.css";
import Login from './components/login';
import Test from './components/Nav';
import {Route, Link, Switch, BrowserRouter as Router} from 'react-router-dom';

function App() {
return (
	<div className="App">
        <Router></Router>
        <h1><Link to="/">Test</Link></h1>
        <div>
            <Switch>
                <Route exact path="/">
                    <Test />
                </Route>
            </Switch>
        </div>
    </div>
);
}


export default App;
